The Hitchhiker's Guide to the Galaxy is a 2005 British-American comic
science fiction film directed by Garth Jennings, based on the book of
the same name by Douglas Adams. It stars Martin Freeman, Sam Rockwell
Mos Def, Zooey Deschanel and the voices of Stephen Fry (the guide book)
and Alan Rickman (Marvin, the Paranoid Android). Shooting was completed
in August 2004 and the movie was released on 28 April 2005 in Europe
Australia and New Zealand, and on the following day in Canada and the
United States.

Adams, who co-wrote the film's screenplay, died in 2001, before
production began. The film is dedicated to him.
